import React from 'react';
import Link from 'next/link';
import Router from 'next/router';

const indexPage =() => (
    <div>
        <h1>The main Page</h1>
        <p>Go to <Link href="/auth"><a>Auth</a></Link> </p>
        <button onClick={()=> Router.push('/auth')}>Got to Auth</button>
    </div>
);

export default indexPage;
